import React from 'react';
import './Profile.css';
import Pfpic from './data/Anipic.png';

const Profile = () => {
	return(
		<div>
			<div className='pf_pic'>
				<img src={Pfpic}/>
			</div>
		</div>
	);
}

export default Profile;
